{"word": ["Lion\n", "\n", "The liger is a hybrid cross between a male Panthera leo (lion), and a female Panthera tigris (tiger) and is denoted scientifically as Panthera tigris \u00d7 Panthera leo.[1][2] A liger resembles a lion with diffused stripes. They are the largest cats in the world,[citation needed] although the Siberian Tiger is the largest pure sub-species. Like tigers, but unlike lions, ligers enjoy swimming. A similar hybrid, the offspring of a male tiger and a female lion is called a tigon.\n", "\n", "According to The Tiger, Symbol of Freedom rare reports have been made of tigresses mating with lions in the wild.[3] Under exceptional circumstances it has been known for a tiger to be forced into ranges inhabited by the Asiatic Lion, Panthera leo persica; however, this combination of species in the wild is considered highly unlikely.[4] The present day range of wild lions and tigers no longer overlap."], "author": "Trigger11"}
